/**
 * @param {number[]} arr
 * @param {Function} fn
 * @return {number[]}
 */
var filter = function(arr, fn) {
   const filteredArr = []
   for(let i = 0, len = arr.length-1; i <= len; i+=1) {
       const item = arr[i]
       if (fn(item, i)) {
           filteredArr.push(item)
       }
   }
   return filteredArr 
};
